import logo from "./logo.svg";
import "./App.css";
import ResponsiveAppBar from "./components/ResponsiveAppBar.js";

function App() {
  return (
    <div className="App">
      <div className="Header">
        <ResponsiveAppBar />
      </div>
      <div className="Content">
        <div className="Left">
          <p>Hacker News Content</p>
        </div>
        <div className="Right">
          <div className="TwitterContainer">
            <p>Twitter Feed</p>
          </div>
          <p>Specific News</p>
        </div>
      </div>
    </div>
  );
}

export default App;
